participantRequirements:
Требования к участнику: в соответствии с пунктом 2 статьи 16 Закона Республики Беларусь от 13 июля 2012 года №419-З «О государственных закупках товаров (работ, услуг)» для подтверждения своих квалификационных данных участники должны предоставить следующие документы: 1. Документ, подтверждающий регистрацию участника в стране его происхождения (свидетельство о государственной регистрации участника либо выписку из торгового реестра страны регистрации участника); 2. Заявления участника: - об отсутствии задолженности по уплате налогов, сборов (пошлин), пеней на первое число месяца, предшествующего дню подачи предложения; - о том, что он не включен в список поставщиков (подрядчиков, исполнителей), временно не допускаемых к участию в процедурах госзакупок; - о том, что он не включен в реестр коммерческих организаций и индивидуальных предпринимателей с повышенным риском совершения правонарушений в экономической сфере; - о том, что он и его работники не оказывают заказчику услуги по организации и проведению процедуры госзакупки, в том числе консультированию, а также формированию требований к предмету госзакупки и (или) подготовке заключения по рассмотрению, оценке и сравнению предложений; - о том, что он не является заказчиком (организатором) проводимой процедуры госзакупки; - о том, что он (физическое лицо) не является работником заказчика; - о том, что он не находиться в процессе ликвидации, реорганизации; - о том, что против него не возбуждено производство по делу об экономической несостоятельности (банкротстве); - о том, что он обладает правомочиями на реализацию товаров (выполнение работ, оказание услуг) на территории Республики Беларусь с использованием товарных знаков и знаков обслуживания.
Дополнительные требования, устанавливаемые к участникам на основании части третьей пп. 1.7 п.1 Постановления Совета Министров Республики Беларусь от 15 июня 2019 г. № 395 «О реализации Закона Республики Беларусь «О внесении изменений и дополнений в Закон Республики Беларусь «О государственных закупках товаров (работ, услуг)», соответствие требованиям подтверждается заявлением участника о том, что: 
– физическое лицо, в том числе индивидуальный предприниматель, – участник процедуры государственной закупки, лицо, осуществляющее полномочия единоличного исполнительного органа юридического лица – участника процедуры государственной закупки, и лицо, имеющее право давать такому юридическому лицу обязательные для исполнения указания на основании учредительных документов или заключенного договора, не должны считаться подвергавшимися административному взысканию за административные правонарушения, предусмотренные в частях 7, 8 и 10 статьи 14.4, частях 4 и 5 статьи 14.5 Кодекса Республики Беларусь об административных правонарушениях;
– отсутствие у участника процедуры государственной закупки – физического лица, в том числе индивидуального предпринимателя, не снятой или не погашенной в установленном порядке судимости за преступления, предусмотренные в статьях 209–212, 216, 235, 243–2433, 424–426, 429–432 и 455 Уголовного кодекса Республики Беларусь;
– отсутствие у лица, осуществляющего полномочия единоличного исполнительного органа юридического лица – участника процедуры государственной закупки, и лица, имеющего право давать такому юридическому лицу обязательные для исполнения указания на основании учредительных документов или заключенного договора, не снятой или не погашенной в установленном порядке судимости за преступления, предусмотренные в статьях 209–212, 216, 235, 243–2433, 424–426, 429–432 и 455 Уголовного кодекса Республики Беларусь.
